const cornerstone = require('cornerstone-core');

const base64Image = '';

function str2ab(str) {
  const buf = new ArrayBuffer(str.length*2); // 2 bytes for each char
  const bufView = new Uint16Array(buf);
  var index = 0;
  for (var i=0, strLen=str.length; i<strLen; i+=2) {
    const lower = str.charCodeAt(i);
    const upper = str.charCodeAt(i+1);
    bufView[index] = lower + (upper <<8);
    index++;
  }

  return bufView;
}

function getPixelData(base64PixelData) {
  const pixelDataAsString = window.atob(base64PixelData);
  const pixelData = str2ab(pixelDataAsString);
  return pixelData;
}

const imagePixelData = getPixelData(base64Image);

function getImage(imageId) {
  const width = 256;
  const height = 256;

  function getPixelData () {
    if(imageId === 'idloader://1') {
        return imagePixelData;
    }

    throw 'unknown imageId';
  }

  const image = {
    imageId: imageId,
    minPixelValue : 0,
    maxPixelValue : 257,
    slope: 1.0,
    intercept: 0,
    windowCenter : 127,
    windowWidth : 256,
    getPixelData: getPixelData,
    rows: height,
    columns: width,
    height: height,
    width: width,
    color: false,
    columnPixelSpacing: 0.8984375,
    rowPixelSpacing: 0.8984375,
    sizeInBytes: width * height * 2
  };

  return {
    promise: new Promise(function(resolve) {
      resolve(image);
    }),
    cancelFn: undefined
  };
}

// register our imageLoader plugin with cornerstone
cornerstone.registerImageLoader('idloader', getImage);
